import { BrowserRouter, Routes, Route } from "react-router-dom";

import Main from "./Main";

import "./App.css";

function App() {
  return (
    <div>
      <mainheader>
        <nav>
          <ul>
            <li>main</li>
            <li>sub</li>
          </ul>
        </nav>
      </mainheader>
      <main>
        <Routes>
          <Route path="/main" element={<Main />}></Route>
        </Routes>
      </main>
    </div>
  );
}

export default App;
